import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

let defaultTextColor = '#fff';
let defaultStyle = {
    color: defaultTextColor
};

let fakeServerData = {
    user: {
        name: 'Brian',
        playlists: [
            {
                name:'My favorites',
                songs:['Beat It','Test']
            },
            {
                name:'My favorites2',
                songs:['Beat It','Test']
            },
            {
                name:'My favorites3',
                songs:['Beat It','Test']
            },
            {
                name:'My favorites4',
                songs:['Beat It','Test']
            }
        ]
    }
};

class Aggregate extends Component {
    render() {
        return (
            <div style={{width: "40%", display: 'inline-block'}}>
                <h2 style={defaultStyle}>{this.props.playlists &&
                    this.props.playlists.length}Number Text</h2>
            </div>
        );
    }
}

class Filter extends Component {
    render() {
        return (
            <div>
                <img/>
                Playlist<input type="text"/>
            </div>
        );
    }
}

class Playlist extends Component {
    render() {
        return (
            <div style={{...defaultStyle,width: "25%",display: 'inline-block'}}>
                <img/>
                <h3>Playlist Name</h3>
                <ul><li>Song 1</li>
                    <li>Song 2</li>
                </ul>
            </div>
        );
    }
}


class App extends Component {
    constructor() {
        super();
        this.state = {serverData: {}}
    }
    componentDidMount() {
        setTimeout(() => {
            this.setState({serverData: fakeServerData});
        }, 1000);
    }
    render() {
        return (
            <div className="App">
                {this.state.serverData.user ? 
                  <div>
                    <h1 style={{...defaultStyle, 'font-size': '54px'}}>Music Switcher</h1>
                    <h2 style={{...defaultStyle}}>{this.state.serverData.user.name}</h2>
                    <Aggregate playlists={this.state.serverData.user.playlists}/> 
                    <Aggregate/>
                    <Filter/>
                    <Playlist/>
                    <Playlist/>
                    <Playlist/>
                    <Playlist/>
                  </div> : <h1>'Loading...'</h1>
                }
            </div>
        );
    }
}
export default App;
